import React, { useEffect, useState } from "react";
import "./app.css";

function App() {
  const [videos, setVideos] = useState([]);
  const [name, setName] = useState('oliver');

  useEffect(() => {
    console.log("useEffect");

    const requestOptions = {
      method: 'GET',
      redirect: 'follow'
    };

    fetch("https://youtube.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&maxResults=25&key=AIzaSyCUvB8Sz1eHI64qbp_-tgDsZWXFfXgZ6d0", requestOptions)
      .then(response => response.json())
      .then(result => console.log(result))
      .catch(error => console.log('error', error));
  }, []);


  return <h1>Hello :)</h1>;
}

export default App;
